import styled from "styled-components";

export const StyledSection = styled.section`
    background-color: var(--color-grey-4);
    width: 100vw;
    height: 100vh;
    display: flex;
    flex-direction: column;


    img {
        width: 35%;
    }

`

export const StyledForm = styled.form`
    background-color: var(--color-grey-3);

`
